import React from "react";
import { Link } from "react-router-dom";

const Header = () => {
  const headerStyle = {
    backgroundColor: "#333",
    color: "#fff",
    padding: "20px",
    textAlign: "center",
  };

  const titleStyle = {
    fontSize: "2.5rem",
    margin: "10px 0",
  };

  const linkStyle = {
    textDecoration: "none",
    color: "#fff",
    fontSize: "1.2rem",
    margin: "0 10px",
    padding: "5px 10px",
    border: "1px solid #fff",
    borderRadius: "5px",
  };

  return (
    <header style={headerStyle}>
      <div>
        <h1 style={titleStyle}>Welcome to My Portfolio</h1>
        <nav>
          <Link to="/" style={linkStyle}>
            Home
          </Link>
          <Link to="/Quotes" style={linkStyle}>
            Quotes
          </Link>
          {/* Add more links as needed */}
        </nav>
      </div>
    </header>
  );
};

export default Header;
